import Table from "react-bootstrap/Table";

export const TransTable = ({ transList }) => {
  return (
    <Table striped bordered hover>
      <thead>
        <tr>
          <th>Date</th>
          <th>Title</th>
          <th>Income</th>
          <th>Expenses</th>
        </tr>
      </thead>
      <tbody>
        {transList.map(({ _id, title, date, amount, type }) => (
          <tr>
            <td>{date.slice(0, 10)}</td>
            <td>{title}</td>
            {type === "income" ? (
              <>
                <td className="text_success">{amount}</td>
                <td></td>
              </>
            ) : (
              <>
                <td></td>
                <td className="text-danger">-{amount}</td>
              </>
            )}
          </tr>
        ))}
      </tbody>
    </Table>
  );
};
